import React from "react"


export default function ToDoList(props){
    const groupElements = props.group.map((group, index) =>{
        return(
            <input 
                title= {props.group.title}
            />
        )
    } )
    return(
        <section>
            <div>
                {groupElements}
                <button>+</button>
            </div>
        </section>
    )
}
